import { Keyboard } from 'react-native';
function shuffleArray(array) {
    // https://stackoverflow.com/questions/2450954/how-to-randomize-shuffle-a-javascript-array
    for (var i = array.length - 1; i > 0; i--) {
        var j = Math.floor(Math.random() * (i + 1));
        var temp = array[i];
        array[i] = array[j];
        array[j] = temp;
    }
}
export function getGroceryList(budget, blacklist) {
    shuffleArray(groceries)

    const allowedGroceries = groceries.filter(item => !blacklist.includes(item.uri))

    console.log('blacklist size', blacklist.length, ' generating from a pool of ', allowedGroceries.length, ' groceries')

    const groceryList = []
    let runningBudget = 0

    for (let i = 0; i < allowedGroceries.length;i++) {
        const cost_i = allowedGroceries[i]['price']
        if (cost_i + runningBudget <= budget) {
            groceryList.push(allowedGroceries[i])
            runningBudget += cost_i
        } else {
            break
        }
    }
    Keyboard.dismiss()
    // console.log(groceryList)
    return { groceryList, totalPrice: runningBudget }

}